import { Card } from "../../Card.styled";

const Footer = () => {
  return (
    <>
      <Card
        dp={"grid"}
        gridC={"40% 20% 20% 20%"}
        height={"10rem"}
        bd={"1px solid red"}
        mg={"0rem 2rem"}
      >
        <Card bd={"1px solid blue"}></Card>
        <Card bd={"1px solid blue"}></Card>
        <Card bd={"1px solid blue"}></Card>
        <Card bd={"1px solid blue"}></Card>
      </Card>
    </>
  );
};

export default Footer;
